  11: 1,
  12: 0
};
function getCatigoryList() {
  const {
    styling,
    tuning
  } = LsCustomData.carComponents;
  const array = [...styling, ...tuning];
  const data = array.map(item => {
    return {
      ...item,
      img: LsCustomData.ComponentsReplace[item.id]
    };
  });
  return data;
}
mp.events.add("C:TuningUI:Ready", () => {
  const data = {
    catigoryList: getCatigoryList(),
    selectedData: selectedData
  };
  Browser.emit("W:TuningUI:SetData", data);
});
mp.events.add("C:TuningUI:Buy", (catigoryId, itemId) => {
  selectedData[catigoryId] = itemId;
  const data = {
    selectedData: selectedData
  };
  Browser.emit("W:TuningUI:SetData", data);
});

